const App = () => {
  const categories = [
    {
      id: 1,
      title: 'hats',
    },
  ];

  return (
    <div className="categories-con">
      {categories.map((category) => (
        <div key={category.id} className="category-con">
          <div className="category-body-con">
            <h2>{category.title}</h2>
            <p>Shop now</p>
          </div>
      </div>
      ))}

    </div>

  );
};

export default App;
